import React from "react";
import csImage from "../../../images/cs.jpg";
export default function CodingSensation() {
  return (
    <div class="website-image" style={{ margin: "0 auto", background: "#fff" }}>
      <img src={csImage} style={{ marginBottom: "20px" }} />
      <p>
        Coding Sensation
        <br />
        <br />
        <a href="https://codingsensation.com" style={{ textAlign: "center" }}>
          Website
        </a>
      </p>
    </div>
  );
}
